import React from "react";
import { FaLinkedin, FaGithub } from 'react-icons/fa';
import { AiFillTwitterCircle, AiOutlineInstagram } from 'react-icons/ai';

const Nav = () =>{
  return (
    <div className="py-5 max-auto max-w-screen-xl text-center mx-auto">
      <div className="w-full box-border">
        <div className="w-full flex justify-around">
          <div className="flex">
            <FaLinkedin size={5} className="mx-4"/>
            <FaGithub className="mx-4"/>
            <AiFillTwitterCircle className="mx-4"/>
            <AiOutlineInstagram className="mx-4"/>
          </div>
          <div>logo</div>
          <div>
            <ul className="flex">
              <li className="mx-4">LATEST WORK</li>
              <li className="mx-4">BLOG</li>
              <li className="mx-4">HIRE ME</li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Nav;
